import './App.css';
import React, { Component } from 'react'
import Navbar from './Navbar';
import NewsItem from './NewsItem';

export default class App extends Component {
  constructor(props){  
    super(props);  
    this.state = {  
         data: 'www.javatpoint.com'  
      }  

  }  
  render() {
    return (
    <div>
      <Navbar />
      <div className="news">
      <div className="container my-3 mx-3"> <NewsItem title={this.state.data} imageURL="https://source.unsplash.com/random/200x200?sig=incrementingIdentifier" /></div>
     <div className="container my-3 mx-3">  <NewsItem title="Today's News 2 "  imageURL="https://source.unsplash.com/random/200x200?sig=2" /></div>
     <div className="container my-3 mx-3">  <NewsItem title="Today's News 3 " imageURL="https://source.unsplash.com/random/200x200?sig=3"/></div>
     </div>
   </div>
    )

  }

}
